export default {"cs":{"dictionary":{"Bold":"Tučné","Italic":"Kurzíva","Underline":"Podtržené","Code":"Kódový blok","Strikethrough":"Přeškrtnuté","Subscript":"Dolní index","Superscript":"Horní index","Italic text":"Kurzíva","Move out of an inline code style":"Odejít ze stylu vloženého kódu","Bold text":"Tučně","Underline text":"Podtrhnutí","Strikethrough text":"Přešktnutí"},getPluralForm(n){return (n == 1 && n % 1 == 0) ? 0 : (n >= 2 && n <= 4 && n % 1 == 0) ? 1: (n % 1 != 0 ) ? 2 : 3;}}}